import { environment } from 'src/environments/environment';
import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders,HttpParams } from '@angular/common/http';
import { ToastrService } from 'ngx-toastr';
import { ToolbarModule } from '@syncfusion/ej2-angular-navigations';

@Injectable({
  providedIn: 'root'
})
export class CommonService{
    constructor(private _http: HttpClient, private _toastr: ToastrService) { }
    
    public CompanyImageWithBase64String:string =  '';


public imagestring:string ='' ;

   /*  DownlLoadFile(filePath) {  
      window.open(environment.apiUrl +'/FileManager/GetAWSFile?filePath='+filePath,'_blank');
    } */

    LoadFile(fileUrl){
      return environment.apiUrl + '/FileManager/GetAWSFile?filePath='+fileUrl;
    }

    GetCompanyImageLogo()
    {
     // return this.CompanyImageWithBase64String;
     return this.imagestring;
    }
    

    DownLoadFile(filePath) {
      let params = new HttpParams();
      params.append("filePath", filePath);
      return this._http.get(environment.apiUrl + '/FileManager/GetAWSFile?filePath=' + filePath, { responseType: 'blob', params: params });
    }

}
